// src/data/savedLooksData.js
const savedLooksData = [
    {
        id: 1,
        title: "Bold Party Look",
        description: "A bold look with dark lipstick and glittery eyeshadow.",
        productsUsed: ["Lipstick X", "Eyeshadow Y", "Highlighter Z"],
        dateSaved: "2024-10-01"
    },
    {
        id: 2,
        title: "Natural Office Look",
        description: "A subtle, natural look for the office with nude lipstick.",
        productsUsed: ["Foundation A", "Lipstick B", "Blush C"],
        dateSaved: "2024-09-28"
    }
];

export default savedLooksData;
